choices.text:
parser.parseArray(componentType, array, fieldName);
if (componentClass == byte.class) {
    return (T) array.toBytes();
}

parser.parseArray(componentType, array, fieldName);
int size = array.size();
Object list = Array.newInstance(componentClass, size);
for (int i = 0; i < size; ++i) {
    Object value = array.get(i);
    if (value == array) {
        Array.set(list, i, list);
    } else {
        Array.set(list, i, value);
    }
}

